import Navbar from './Navbar'
import {
  Table,
  Button,
  Container,
  Modal,
  ModalHeader,
  ModalBody,
  FormGroup,
  ModalFooter,
} from "reactstrap";

const Favorites = () => {
  return(
    <div>
      <Table>
        <tr>
          <th>ANime</th>
        </tr>
